import { useCallback, useState } from 'react'
import { Link } from 'react-router-dom'
import Button from '../shared/Button'
import TextField from '../shared/TextField'

function Form() {
  const [formValues, setFormValues] = useState({
    email: '',
    password: '',
  })

  const handleFormValues = useCallback(() => {})

  return (
    <div className="sm:container sm:mx-auto py-6 px-6 sm:px-36">
      <TextField label="이메일" name="email" placeholder="prumpy11@naver.com" />
      <div className="my-6"></div>
      <TextField label="패스워드" name="password" type="password" />
      <div className="my-6"></div>
      <Button label="로그인" size="full" />
      <Link to="/signup" className="flex justify-center">
        <p className="text-xs text-brown-100 hover:text-salmon-100">
          {' '}
          아직 계정이 없으신가요?{' '}
        </p>
      </Link>
    </div>
  )
}

export default Form
